      "descripcion": "Desarrollo e implementaci\xF3n de m\xF3dulos empresariales utilizando Java EE 7 y PostgreSQL, incluyendo el dise\xF1o de procedimientos almacenados y triggers para garantizar la integridad y eficiencia de los datos.\\n\\nDise\xF1o, optimizaci\xF3n e integraci\xF3n de interfaces de usuario con PrimeFaces, asegurando una comunicaci\xF3n efectiva entre el backend y el frontend.\\n\\nExperiencia en soporte t\xE9cnico y mantenimiento preventivo y correctivo de equipos de c\xF3mputo y redes.\\n\\nCapacitaci\xF3n y acompa\xF1amiento a usuarios finales en el uso eficiente de herramientas tecnol\xF3gicas, orientado a la mejora de la productividad."
